//import { useParams, Link } from "react-touter-dom";
import { useState, useEffect } from "react";

export default function Contact() {
  const [dateUser, setDateUser] = useState({});
  useEffect(() => {
    fetch(`https://dummyjson.com/users`)
      .then((res) => res.json())
      .then((users) => setDateUser(users));
  }, []);

  return (
    <div>
      <h2>{dateUser.firstName.value}</h2>
    </div>
  );
}
